class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m,n = len(board),len(board[0])
        max_c = [[-inf]*3 for _ in range(m)]
        for i in range(m):
            lst = [x for x in range(n)]
            lst.sort(key=lambda x:board[i][x],reverse=True)
            max_c[i] = lst[:3]
        ans = -inf
        for i in range(m-2):
            for j in range(i+1,m-1):
                for k in range(j+1,m):
                    for ci in max_c[i]:
                        for cj in max_c[j]:
                            for ck in max_c[k]:
                                if ci != cj and cj != ck and ci != ck:
                                    ans = max(ans, board[i][ci]+board[j][cj]+board[k][ck])
        return ans
